import React from "react";
import { useEffect } from "react";
import { useSelector } from "react-redux";
import { instance } from "../../axios/axiosInstance";
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

const Rank = () => {
  var score = useSelector((state) => state.score);
  const history = useHistory();

  function getRank() {
    instance.post("rank", { finalScore: score }).then((res) => {
      console.log(res);
    });
  }
  useEffect(() => {
    getRank();
  }, []);
  const handleNavigation=()=>{

    history.push("/practice");
  }
  return (
    <Card sx={{ minWidth: 275 ,margin:10,alignItems:"center"}} >
      <CardContent>
      
        <Typography sx={{ mb: 1.5 }} color="#0d6efd">
          Your Score Is :{score}
       
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="large" onClick={()=>handleNavigation()}>Play Again</Button>
      </CardActions>
    </Card>
  );
};

export default Rank;
